import math
import numpy as np
import random

class Model:

    def trend_linear(self, N, a, b):
        t = np.arange(0, N, 1)
        x = a * t + b
        return x

    def exp(self, N, a, b):
        t = np.arange(0, N, 1)
        x = b * np.exp(a * t)
        return x

    def noise(self, N, R):
        noise = np.random.randint(R+1, size=(N))
        return noise

    @staticmethod
    def lin_rand_arr_flxd(seed, size):
        m = 32768
        a = 23
        b = 12345
        if size == 1:
            return math.ceil(math.fmod(a * math.ceil(seed) + b, m))
        r = [0 for i in range(size+1)]
        r[0] = math.ceil(seed)
        for i in range(1, size+1):
            r[i] = math.ceil(math.fmod((a * r[i - 1] + b), m))
        return r[1:size+1]

    def my_noise(self, seed, N, R):
        noise = self.lin_rand_arr_flxd(seed, N)
        my_noise = [i for i in range(N)]
        for i in my_noise:
            my_noise[i] = (((noise[i] - min(noise))/(max(noise)-min(noise)))-0.5)*2*R
        return my_noise

    def shift(self, inData, C, N1, N2):
        k = np.arange(N1, N2, 1)
        for i in range(N2-N1):
            inData[k[i]] += C
        return inData

