    def spikes(self, inData, N, M, R, seed):
        Rs = 0.1 * R
        sampl = self.my_noise(seed, M, Rs)
        signs = np.random.randint(2, size=M)
        for i in range(M):
            if signs[i] == 0:
                signs[i] = -1
            sampl[i] += Rs * R * signs[i]
        t_1 = random.sample(list(range(1, N + 1)), M)
        for i in range(M):
            inData[t_1[i]] += sampl[i]
        return inData

    def harm(self, N, A, f, dt):
        k = np.arange(0, N, 1)
        x = A * np.sin(2 * math.pi * f * dt * k)
        return x

    def polyHarm(self, N, A0, f0, A1, f1, A2, f2, dt):
        k = np.arange(0, N, 1)
        x0 = A0 * np.sin(2 * math.pi * f0 * dt * k)
        x1 = A1 * np.sin(2 * math.pi * f1 * dt * k)
        x2 = A2 * np.sin(2 * math.pi * f2 * dt * k)
        x = x0 + x1 + x2
        return x

    def frequencyModulation(self, N, A, f0, df, f1, dt):
        k = np.arange(0, N, 1)
        return A * np.sin(f0 * dt * k + df * np.cos(f1 * dt * k))

    def windowing(self, data, N, L):
        for i in range(N-L, N):
            data[i] = 0
        return data

    def addModel(self, data1, data2, N):
        addResult = []
        for i in range(N):
            addResult.append(data2[i] + data1[i])
        return addResult

    def multModel(self, data1, data2, N):
        multResult = []
        for i in range(N):
            multResult.append(data2[i] * data1[i])
        return multResult

    def convolModel(self, x, h, N, M):
        out_data = []
        for i in range(N):
            y = 0
            for j in range(M):
                y += x[i-j] * h[j]
            out_data.append(y)
        return out_data

    def cardiogram(self, N, f, dt, a):
        harm = self.harm(N, 1, f, dt)
        exp_trend = self.exp(N, -a * dt, 1)
        h = self.multModel(harm, exp_trend, N)
        h_n = []
        max_h = max(h)
        for i in range(len(h)):
            h_n.append(h[i] / max_h * 120)
        return h_n

    def rhythm(self, N, M, R, Rs):
        x_t = [0 for _ in range(N)]
        for i in range(N):
            if i % M == 0 and i != 0:
                x_t[i] = random.random() * 2 * Rs + (R - Rs)
        return x_t

